import React from 'react';
import ReservationForm from './ReservationForm';
import './Home.css';

const Home = () => {
  return (
    <main className="Home">
      <section className="hero">
        <div className="hero-text">
          <h2>Welcome to Little Lemon Restaurant</h2>
          <p>Enjoy a delightful dining experience at Little Lemon. Make a reservation today!</p>
        </div>
      </section>
      <section className="reservation-form">
        <ReservationForm />
      </section>
    </main>
  );
};

export default Home;
